import '../Styles/articles.scss';
import csvFile from '../INR.csv'
const Papa = require('papaparse');

let csv = null;

// if (csv != null) {
    Papa.parse(csvFile, {
        download: true,
        complete: function (input) {
            console.log('LOADING...')
            csv = input.data;
            console.log(input.data)
            console.log(typeof csv)
        }
    });
// }

export default csv;
